/*Data for the table `data` */

insert  into `data`(`no_data`,`title`,`sub`) values (1,'Sistem Rekomendasi Masih Menggunakan K-Means Clutering','gak usah ada sub\r\n'),(2,'Petunjuk Penggunaan','Akan ada login admin yang menampilkan halaman CRUD data..\r\n'),(3,'Tentang','	Sistem ini adalah sistem yang mirip dengan e-commerce.\r\nDalam sistem ini tujuan utamanya adalah menampilkan produk yang akan direkomendasikan kepada pengunjung.\r\nRekomendasi akan dilakukan perkategori berdasarkan rating yang dimiliki oleh produk itu sendiri.\r\n	\r\n	Untuk rekomendasi akan menggunakan algoritma ICHM. Dalam hal ini ICHM dibangun untuk merekomendasikan produk yang belum direkomendasikan oleh si pengunjung itu sendiri. \r\nTahapannya adalah pertama sekali data rating akan diclustering kemudian item rating dan hasil clustering yang dinamakan group rating masing-masing akan dicari similaritynya.\r\nKemudian hasil similarity akan digabungkan secara linear dan akan dihitung prediksi (Top N rekomendasi) yang akan menjadi produk andalan.\r\n\r\n\r\nSemangat berjuang TA 15...'),(4,'Wewenang','lmkansfas alsmdkasd'),(5,'Petunjuk Admin','Admin dapat mengolah data yang akan ditampilkan pada sistem yang dibangun.\r\nTerdapat dua menu yang disediakan pada halaman admin yaitu Referensi dan Analisa Data.\r\nPada menu Referensi dapat melihat submenu berupa Daftar Produk, Daftar Kategory, Daftar Pengunjung dan Daftar produk yang di rating oleh pengunjung. Sementara pada Menu Analisis Data merupakan analisis data untuk proses K-Means Clustering..'),(6,'Wewenang Admin','Wewenang yang dimiliki oleh admin atau administrator adalah melakukan CRUD pada data seperti data produk dan data kategory.\r\nUntuk data user dan data produk yang sudah dirating hanya dapat view saja.');

